const BASE_URL = 'http://localhost:3000'

export const createUser = async (username, password) => {
const result = await fetch(`${BASE_URL}/api/users`, {
    method: 'POST',
    headers: {
        'Content-Type': 'application/json'
    },
    body: JSON.stringify({
    username, password
    })

})
console.log('result', await result)
}
